const Navigation = ({ onRouteChange, isSignedIn }) => {
  if (isSignedIn) {
    return (
      <nav
        id="navigation"
        className="flex justify-end bg-white border-b-2 border-blue-400"
      >
        <p
          onClick={() => onRouteChange("signout")}
          className="f5 link dim blue pa3 pr4 pointer"
        >
          Log out
        </p>
      </nav>
    )
  } else {
    return (
      <nav
        id="navigation"
        className="flex justify-end bg-white border-b-2 border-blue-400"
      >
        <p>-Smart</p>
        <p
          onClick={() => onRouteChange("signin")}
          className="f5 link dim blue pa3 pointer"
        >
          Log in
        </p>
        <p
          onClick={() => onRouteChange("register")}
          className="f5 link dim blue pa3 pr4 pointer"
        >
          Sign up
        </p>
      </nav>
    )
  }
}

export default Navigation
